function loadSettings(callback) {
  chrome.storage.local.get(
  {
    header: "data:image/jpeg;base64,",
    headerheight: 300,
    links: [["Google", "https://google.com/", "#4285F4"],["YouTube", "https://youtube.com/", "#ff0000"],["Facebook", "https://facebook.com/", "#3a5795"],["Twitter","https://twitter.com/", "#55acee"]],
    colorbg: "#FFFFFF",
    colorfg: "#DEDADA",
    colorhi: "#B8B8B8"
  }, function(items)
  {
    callback(items)
  });
}
